import React, { Component } from 'react';

class Social extends Component {
    render() {
        return (
            <div class="social">
            <a href="https://github.com/ErrlyBird" target="_blank"><i class="fab fa-github"></i></a>
            <a href="https://Instagram.com/errlybirdofficial" target="_blank"><i class="fab fa-instagram"></i></a>
            <a href="https://www.facebook.com/ErrlyBirdy" target="_blank"><i class="fab fa-facebook-f"></i></a>
            </div>
            )
        }
    }

export default Social
